                        <Card className={classes.root}>
                            <CardActionArea>
                                <CardContent>
                                <Typography gutterBottom variant="h5" component="h2">
                                        {item.PTIN}
                                </Typography>
                                    <Typography gutterBottom variant="h5" component="h2">
                                        {item.Owner_Name}
                                    </Typography>
                                    <Typography gutterBottom variant="h5" component="h2">
                                    House No. {item.House_No} {item.Zone}
                                    </Typography>
                                </CardContent>
                            </CardActionArea>
                            <CardActions>
                                <Button size="small" color="primary">
